paragraph -->\n\n<!-- wp:heading -->\n<h2>Key features of the Flute Artist template</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Flexible portfolio website for musicians</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Elegant design ideal for the niche</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Includes the option to add audio and video</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Dedicated portfolio and contact page</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Flexible layout that can be fully customized</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Page builder compatible for ease of use</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\";s:12:\"post-excerpt\";s:395:\"The Flute Artist template has been designed to reflect the elegance and classic nature of the instrument and the industry. It’s a very calm layout with sober colors and an instant appeal. The homepage begins dark and quickly opens out to include lots of white space, modern, elegant fonts and lots of imagery to set &hellip;<p class=\"read-more\"> <a class=\"\" href=\"\">  Read More &raquo;</a></p>\";s:5:\"pages\";a:4:{s:8:\"id-59104\";a:12:{s:5:\"title\";s:7:\"Contact\";s:18:\"featured-image-url\";s:79:\"https://websitedemos.net/wp-content/uploads/2022/08/flute-artist-08-contact.jpg\";s:19:\"thumbnail-image-url\";s:87:\"https://websitedemos.net/wp-content/uploads/2022/08/flute-artist-08-contact-600x890.jpg\";s:18:\"astra-page-api-url\";s:64:\"https://websitedemos.net/flute-artist-08/wp-json/wp/v2/pages/656\";s:12:\"dynamic-page\";s:2:\"no\";s:14:\"astra-page-url\";s:43:\"//websitedemos.net/flute-artist-08/contact/\";s:15:\"astra-sites-tag\";a:1:{i:415;s:7:\"contact\";}s:15:\"site-pages-type\";s:4:\"free\";s:23:\"site-pages-page-builder\";s:9:\"gutenberg\";s:19:\"site-pages-category\";a:0:{}s:26:\"site-pages-parent-category\";a:2:{i:60;s:8:\"business\";i:61;s:4:\"free\";}s:16:\"required-plugins\";a: