INSERT INTO `wp_posts` VALUES (135,1,'2024-01-08 12:59:15','2024-01-08 12:59:15','<!-- wp:areoi/container {\"block_id\":\"f68b0a1b-d357-4337-aaa2-4e5892e21ffb\"} -->\n<!-- wp:areoi/row {\"block_id\":\"ced552bc-6412-4dff-9a44-f7f3dac9590e\"} -->\n<!-- wp:areoi/column {\"block_id\":\"88baea5f-2166-4496-bec1-115d9de65a7c\",\"className\":\"col-md-2\"} -->\n<!-- wp:paragraph -->\n<p>- Blog</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":1} -->\n<h1 class=\"wp-block-heading\">Blog &amp; News</h1>\n<!-- /wp:heading -->\n\n<!-- wp:areoi/button {\"block_id\":\"bb7a0467-9204-4393-a002-c1e50d0ac595\",\"text\":\"Get in touch\",\"className\":\"btn-dark\"} /-->\n<!-- /wp:areoi/column -->\n\n<!-- wp:areoi/column {\"block_id\":\"32dea00f-07bb-487c-885e-045eea2d1cd8\",\"className\":\"col-md-10\"} -->\n<!-- wp:query {\"queryId\":11,\"query\":{\"perPage\":3,\"pages\":0,\"offset\":0,\"postType\":\"post\",\"order\":\"desc\",\"orderBy\":\"date\",\"author\":\"\",\"search\":\"\",\"exclude\":[],\"sticky\":\"\",\"inherit\":false}} -->\n<div class=\"wp-block-query\"><!-- wp:post-template -->\n<!-- wp:columns {\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:latest-posts /--></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n<!-- /wp:post-template --></div>\n<!-- /wp:query -->\n<!-- /wp:areoi/column -->\n<!-- /wp:areoi/row -->\n<!-- /wp:areoi/container -->','Blog','','inherit','closed','closed','','27-revision-v1','','','2024-01-08 12:59:15','2024-01-08 12:59:15','',27,'http://devfoliox.local/?p=135',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (136,1,'2024-01-08 12:59:56','2024-01-08 12:59:56','<!-- wp:areoi/container {\"block_id\":\"fdc992b2-51cb-4956-bda6-e1a0f1ff3bbd\"} -->\n<!-- wp:areoi/row {\"block_id\":\"03fdec51-109a-4cfe-b37a-7e8aaecdf9ce\"} -->\n<!-- wp:areoi/column {\"block_id\":\"64110d68-f40f-4732-83ed-9f2b678776c2\"} -->\n<!-- wp:paragraph -->\n<p>There are two reasons why it’s sometimes hard to make a choice; either there are too few options to choose from, or there are too many. When it comes to programming languages, there is an embarrassment of riches, which in turn can cause mental gridlock. There’s Python, Java, JavaScript, C/CPP, PHP, Swift, C#, Ruby, Objective-C, and SQL, and that’s not even the full list! How do you choose?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Now, bear in mind that as far as programmers go, there’s no such thing as knowing too many languages. A programmer with a grasp of many languages is a programmer who is highly marketable and very much in demand. Upskilling is always a smart way to go.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Still, you have to start somewhere; and that should be with one of the more popular languages, one that’s experiencing unprecedented growth in demand.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This article will provide you with an introduction to JavaScript by giving you 10 solid reasons why learning JavaScript is critical for your growth and development as a programmer. But first, let’s touch upon some JavaScript basics.</p>\n<!-- /wp:paragraph -->\n<!-- /wp:areoi/column -->\n<!-- /wp:areoi/row -->\n<!-- /wp:areoi/container -->','Top 10 Reasons to Learn JavaScript','','publish','open','open','','top-10-reasons-to-learn-javascript','','','2024-01-08 12:59:56','2024-01-08 12:59:56','',0,'http://devfoliox.local/?p=136',0,'post','',0);
INSERT INTO `wp_posts` VALUES (137,1,'2024-01-08 12:59:56','2024-01-08 12:59:56','<!-- wp:areoi/container {\"block_id\":\"fdc992b2-51cb-4956-bda6-e1a0f1ff3bbd\"} -->\n<!-- wp:areoi/row {\"block_id\":\"03fdec51-109a-4cfe-b37a-7e8aaecdf9ce\"} -->\n<!-- wp:areoi/column {\"block_id\":\"64110d68-f40f-4732-83ed-9f2b678776c2\"} -->\n<!-- wp:paragraph -->\n<p>There are two reasons why it’s sometimes hard to make a choice; either there are too few options to choose from, or there are too many. When it comes to programming languages, there is an embarrassment of riches, which in turn can cause mental gridlock. There’s Python, Java, JavaScript, C/CPP, PHP, Swift, C#, Ruby, Objective-C, and SQL, and that’s not even the full list! How do you choose?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Now, bear in mind that as far as programmers go, there’s no such thing as knowing too many languages. A programmer with a grasp of many languages is a programmer who is highly marketable and very much in demand. Upskilling is always a smart way to go.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Still, you have to start somewhere; and that should be with one of the more popular languages, one that’s experiencing unprecedented growth in demand.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This article will provide you with an introduction to JavaScript by giving you 10 solid reasons why learning JavaScript is critical for your growth and development as a programmer. But first, let’s touch upon some JavaScript basics.</p>\n<!-- /wp:paragraph -->\n<!-- /wp:areoi/column -->\n<!-- /wp:areoi/row -->\n<!-- /wp:areoi/container -->','Top 10 Reasons to Learn JavaScript','','inherit','closed','closed','','136-revision-v1','','','2024-01-08 12:59:56','2024-01-08 12:59:56','',136,'http://devfoliox.local/?p=137',0,'revision','',0);
